import React, { useEffect, useState } from "react";
import axios from "axios";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar.jsx";
import Search from "./components/Search.jsx";
import Add from "./components/Add.jsx";
import Flight from "./components/Flight.jsx";
import Home from "./components/Home.jsx";
import Hotel from "./components/Hotel.jsx";
import Reservation from "./components/Reservation.jsx";

const App = () => {
  const [flights, setFlights] = useState([]);
  const [reservation, setReservation] = useState([]);
  const [query, setQuery] = useState({});
  const [ren, setRen] = useState(false);

  useEffect(() => {
    axios
      .get("http://localhost:3000/api/flight/")
      .then((res) => {
        setFlights(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  useEffect(() => {
    axios
      .get("http://localhost:3000/api/flight/reservation")
      .then((res) => {
        setReservation(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  const test = [
    {
      type_flight: "oneway",
      capacite: 100,
      go_date: "fghjklm",
      return_date: "vghbjnjk,",
      destination: "tunsie",
      price: 500,
    },
    {
      type_flight: "oneway",
      capacite: 100,
      go_date: "fghjklm",
      return_date: "vghbjnjk,",
      destination: "tunsie",
      price: 500,
    },
    {
      type_flight: "oneway",
      capacite: 100,
      go_date: "fghjklm",
      return_date: "vghbjnjk,",
      destination: "tunsie",
      price: 500,
    },
    {
      type_flight: "oneway",
      capacite: 100,
      go_date: "fghjklm",
      return_date: "vghbjnjk,",
      destination: "tunsie",
      price: 500,
    },
  ];
  return (
    <>
      <Navbar />
      <Search />

      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/hotel" element={<Hotel />} />
          <Route path="/reserv" element={<Reservation reservation={test} />} />

          <Route path="/flights" element={<Flight flights={test} />} />

          <Route path="/flight/add" element={<Add />} />
        </Routes>
      </Router>
    </>
  );
};

export default App;
